import React from "react";
import { AboutСontainer } from "./style";
import Data from "Entites/Data";

export default function AboutPerson() {
  const {
    main_number,
    first_number,
    second_number,
    mail,
    site,
    address,
    addressСoordinates,
    dateOfBirth,
    rank,
  } = Data.person;

  return (
    <AboutСontainer>
      <div>{main_number}</div>
    </AboutСontainer>
  );
}
